INSERT INTO `pages` VALUES (19, 'ADTEBN', 0, 1, 'প্রবেশ ফি', 'প্রবেশ ফি', 'content/3vQ4RwUTgHxYbmu.png', 'data:image/png;base64,', 1, 'page', '<h1 style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; font-size: 30px; line-height: inherit; font-family: SolaimanLipi, Arial, Vrinda, FallbackBengaliFont, Helvetica, sans-serif, Calibri; vertical-align: baseline; color: rgb(12, 138, 1);\">সাফারী পার্ক পরিদর্শন/প্রবেশ ফি</h1><h4><p style=\"padding: 15px 0px 0px; border: 0px; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: medium; line-height: 20px; font-family: SolaimanLipi, Arial, Vrinda, FallbackBengaliFont, Helvetica, sans-serif, Calibri; vertical-align: baseline; color: rgb(18, 56, 15); text-align: justify;\">পর্যটকগণ নির্ধারিত ফি প্রদানের মাধ্যমে সাফারী পার্ক পরিদর্শন করতে পারবেন। সরকার কর্তৃক ধার্যকৃত ফি নিম্নরূপ</p><p style=\"padding: 15px 0px 0px; border: 0px; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: medium; line-height: 20px; font-family: SolaimanLipi, Arial, Vrinda, FallbackBengaliFont, Helvetica, sans-serif, Calibri; vertical-align: baseline; color: rgb(18, 56, 15); text-align: justify;\">১. প্রাপ্ত বয়স্ক প্রতিজন - ৫০টাকা<br>২. অপ্রাপ্ত বয়স্ক প্রতিজন - ২০টাকা<br>৩. স্কুলের ছাত্র/ছাত্রী (১৫ বৎসরের নীচে) - ১০টাকা<br>৪. শিক্ষা প্রতিষ্ঠান থেকে শিক্ষা সফরে আগত শিক্ষার্থী গ্র“প (৪০-১০০ জন) - ৪০০ টাকা<br>৫. শিক্ষা প্রতিষ্ঠা থেকে আগত শিক্ষার্থী গ্র“প (১00 জনের উর্ধে) - ৮০০টাকা<br>৬. বিদেশী পর্যটক - ৫ ইউ এস ডলার বা সম-পরিমাণে বাংলাদেশী টাকা<br><br></p></h4><h3 style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: SolaimanLipi, Arial, Vrinda, FallbackBengaliFont, Helvetica, sans-serif, Calibri; vertical-align: baseline; color: rgb(12, 138, 1);\">পার্কিং ফি :</h3><h4><p style=\"padding: 15px 0px 0px; border: 0px; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: medium; line-height: 20px; font-family: SolaimanLipi, Arial, Vrinda, FallbackBengaliFont, Helvetica, sans-serif, Calibri; vertical-align: baseline; color: rgb(18, 56, 15); text-align: justify;\">১। বাস/ কোচ/ ট্রাক প্রতিটি -	২০০ টাকা<br>২। মিনিবাস / মাইক্রোবাস প্রতিটি	-	১০০	টাকা<br>৩। কার/ জীপ প্রতিটি	-	৬০ টাকা<br>৪। অটোরিক্সা / টেম্পু (সি এনজি ) প্রতিটি -	২০	টাকা<br>৫। সাফারী জীপে করে সাফারী পার্ক পরিদর্শন (অপ্রাপ্ত বয়স্ক) প্রতিজন - ৫০ টাকা<br>৬। সাফারী জীপে করে সাফারী পার্ক পরিদর্শন (প্রাপ্ত বয়স্ক) প্রতিজন - ১০০ টাকা<br>৭। গাড়ী করে সাফারী পার্ক পরিদর্শন প্রতিজন - ১০০ টাকা<br><br></p></h4><h3 style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: SolaimanLipi, Arial, Vrinda, FallbackBengaliFont, Helvetica, sans-serif, Calibri; vertical-align: baseline; color: rgb(12, 138, 1);\">অন্যান্য ফিঃ</h3><h4><p style=\"padding: 15px 0px 0px; border: 0px; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: medium; line-height: 20px; font-family: SolaimanLipi, Arial, Vrinda, FallbackBengaliFont, Helvetica, sans-serif, Calibri; vertical-align: baseline; color: rgb(18, 56, 15); text-align: justify;\">১। প্রকৃতিবীক্ষণ কেন্দ্র প্রতিজন - ২০ টাকা <br>২। হাতী দেখার গ্যালারী প্রতিজন - ২০ টাকা <br>৩। বার্ড শো গ্যালারী প্রতিজন - ২০ টাকা <br>৪। ফেন্সী কার্প গার্ডেন গ্যালারী প্রতিজন - ১০ টাকা <br>৫। মেরিন এ্যাকুরিয়াম গ্যালারী প্রতিজন - ১০ টাকা <br>৬। মেকাউ পাখিশালা গ্যালারী প্রতিজন - ১০ টাকা <br>৭। চিলড্রেন পার্কে প্রবেশ প্রতিজন - ১০ টাকা <br>৮। রোলার কোস্টার প্রতিজন - ২০ টাকা <br>৯। প্যারাট্রুপার প্রতিজন - ১০ টাকা <br>১০। মেরি গো রাউন্ড প্রতিজন - ১০ টাকা <br>১১। মিনি ট্রেন প্রতিজন - ১০ টাকা <br>১২।ক্রাউন ফিজেন্ট এ্যভিয়ারী পরিদর্শন -	১০ টাকা<br>১৩। ধনেশ এ্যাভিয়ারী পরিদর্শন - ১০ টাকা <br>১৪। প্যারট এ্যাভিয়ারী পরিদর্শন -	১০ টাকা<br>১৫। প্যাডেল বোটে ভ্রমন (এিশ মিনিট ) - ২০০টাকা<br>১৬। পাবলিক টয়লেট প্রতিজন - ০৫ টাকা</p></h4><ul>\r\n                            </ul>', 1, 82, '127.0.0.1', '1503162089', 87);
