INSERT INTO `pages` VALUES (25, 'QRFGNX', 20, 0, 'কোর সাফারী পার্ক', 'কোর সাফারী পার্ক', 'content/leGxHvqugSOJzCW.gif', 'data:image/png;base64,', 1, 'page', '<p style=\"text-align: justify;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"1.jpg\" style=\"width: 100%;\"></p><h1 style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; font-size: 30px; line-height: inherit; font-family: SolaimanLipi, Arial, Vrinda, FallbackBengaliFont, Helvetica, sans-serif, Calibri; vertical-align: baseline; color: rgb(12, 138, 1);\"><br></h1><h1 style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; font-size: 30px; line-height: inherit; font-family: SolaimanLipi, Arial, Vrinda, FallbackBengaliFont, Helvetica, sans-serif, Calibri; vertical-align: baseline; color: rgb(12, 138, 1);\">কোর সাফারী পার্ক</h1><p style=\"padding: 15px 0px 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; font-size: medium; line-height: 20px; font-family: SolaimanLipi, Arial, Vrinda, FallbackBengaliFont, Helvetica, sans-serif, Calibri; vertical-align: baseline; color: rgb(18, 56, 15); text-align: justify;\">কোর সাফারী পার্ক কোর সাফারী পার্কে সাফারী গাড়ী ব্যতীত কোন পর্যটক প্রবেশ করতে পারবেন না তবে তিনি বন্যপ্রাণী বেষ্টনীতে মুক্ত অবস্থায় প্রাকৃতিক পরিবেশে বিচরণরত বন্যপ্রাণী সমূহ গাড়ীতে চড়ে অবলোকন করতে পারবেন। কোর সাফারী পার্ক ১৩৩৫ একর এলাকা নিয়ে প্রতিষ্ঠা করা হবে-যার মধ্যে ২০.০ একরে বাঘ, ২১.০ একরে সিংহ, ৮.৫০ একরে কালো ভালুক, ৮.০ একরে আফ্রিকান চিতা, ৮১.৫০ একর চিত্রা হরিণ, ৮০.০ একরে সাম্বাব ও গয়াল, ১০৫.০ একরে হাতী, ৩৫.০ একরে জলহস্তী, ২২.০ একরে মায়া ও প্যারা হরিণ, ২৫.০ একরে নীলগাই এবং বারো সিংগা, ১১৪.০ একরে ঙৎুী এধুবষষব, ঝধনষব এবং ইষধপশ ইঁপশ সহ পাখীদ্বীপ, ৪০৭.০ একরে বন্য মহিষ, ডধঃবৎ ইঁভভধষড়, ডধঃবৎ ইঁপশ এবং ওহফরধহ ইরংড়হ থাকবে এবং আফ্রিকান সাফারী পার্কের জন্য বরাদ্দ ২৯০.০ একর এলাকাকে সুবিন্যাস্থ করা হবে।</p><p style=\"text-align: justify;\"><br style=\"font-family: SolaimanLipi, Arial, Vrinda, FallbackBengaliFont, Helvetica, sans-serif, Calibri; font-size: medium; text-align: start;\"><br style=\"font-family: SolaimanLipi, Arial, Vrinda, FallbackBengaliFont, Helvetica, sans-serif, Calibri; font-size: medium; text-align: start;\"></p><h3 style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: SolaimanLipi, Arial, Vrinda, FallbackBengaliFont, Helvetica, sans-serif, Calibri; vertical-align: baseline; color: rgb(12, 138, 1);\">কোর সাফারী পার্কের দর্শনীয় স্হাপনাসমূহ</h3><p style=\"text-align: justify;\"><br style=\"font-family: SolaimanLipi, Arial, Vrinda, FallbackBengaliFont, Helvetica, sans-serif, Calibri; font-size: medium; text-align: start;\"></p><div class=\"list-l\" style=\"margin: 0px 50px 0px 30px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; font-size: medium; line-height: inherit; font-family: SolaimanLipi, Arial, Vrinda, FallbackBengaliFont, Helvetica, sans-serif, Calibri; vertical-align: baseline; float: left; min-height: 225px;\"><ul style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; list-style: none;\"><li style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\"><font color=\"#12380f\" face=\"inherit\"><span style=\"border-style: initial; border-color: initial; border-image: initial; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: 14px; line-height: 20px;\">১. বাঘ সাফারী</span></font></li><li style=\"margin: 0px; padding: 0px; border: 