INSERT INTO `pages` VALUES (26, 'GXNMQW', 20, 0, 'সাফারী কিংডম', 'সাফারী কিংডম', '', '', 2, 'page', '<h1 style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; font-size: 30px; line-height: inherit; font-family: SolaimanLipi, Arial, Vrinda, FallbackBengaliFont, Helvetica, sans-serif, Calibri; vertical-align: baseline; color: rgb(12, 138, 1);\"><img src=\"data:image/jpeg;base64,\" data-filename=\"sk.jpg\" style=\"width: 789px;\"><br></h1><h1 style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; font-size: 30px; line-height: inherit; font-family: SolaimanLipi, Arial, Vrinda, FallbackBengaliFont, Helvetica, sans-serif, Calibri; vertical-align: baseline; color: rgb(12, 138, 1);\"><br></h1><h1 style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; font-size: 30px; line-height: inherit; font-family: SolaimanLipi, Arial, Vrinda, FallbackBengaliFont, Helvetica, sans-serif, Calibri; vertical-align: baseline; color: rgb(12, 138, 1);\">সাফারী কিংডম</h1><h4><p style=\"padding: 15px 0px 0px; border: 0px; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: medium; line-height: 20px; font-family: SolaimanLipi, Arial, Vrinda, FallbackBengaliFont, Helvetica, sans-serif, Calibri; vertical-align: baseline; color: rgb(18, 56, 15); text-align: justify;\">সাফারী কিংডমে পর্যটকগণ পায়ে হেঁটে ঘুরে বেড়াতে পারবে এবং প্রাণিকূলকে ছোট-খাট বেস্টনীর মধ্যে আবদ্ধ রাখা হবে। সাফারী কিংডমের মূল লক্ষ্য হচ্ছে: বিভিন্ন বন্যপ্রাণীর নৈপূণ্য ও খেলাধুলা প্রদশর্ণের মাধ্যমে পর্যটকদের চিত্তবিনোদন, বন্যপ্রাণী সংক্রান্ত শিক্ষা ও গবেষণার সুযোগ সৃষ্টি করা। সাফারী কিংডম ৫৭৫.০ একর এলাকা নিয়ে প্রতিষ্ঠা করা হবে। এর প্রধান কার্যক্রমের মধ্যে রয়েছে প্রকৃতিবীক্ষণ কেন্দ্র, জিরাফ ফিডিং স্পট, পেলিকেন আয়ল্যান্ড, বোটিং ও লেকজোন; বৃহৎ আকারের গাছপালা ঘেরা ক্রাউন্ট ফিজেন্ট এভিয়ারী, ধনেশ এভিয়ারী, প্যারট এভিয়ারীসহ দেশি-বিদেশী পাখির পাখীশালা (আরধৎু), কুমির পার্ক, অর্কিড হাউজ, প্রজাপতি কর্ণার, শকুন ও পেঁচা কর্ণার, এগ ওয়ার্ল্ড, কচ্ছপ-কাছিম ব্রিডিং সেন্টার, লামচিতা হাউজ, ক্যাঙ্গারু বাগান, হাতী-শো গ্যালারী, ময়ুর/মেকাউ ওপেন ল্যান্ড, সর্প পার্ক, ফেন্সি কার্প গার্ডেন, ফেন্সি ডার্ক গার্ডেন, লিজার্ড পার্ক, ফুডকোটর্ , পর্যবেক্ষন টাওয়ার ও জলাধার ইত্যাদি।&nbsp;<br><br><br></p></h4><h3 style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: SolaimanLipi, Arial, Vrinda, FallbackBengaliFont, Helvetica, sans-serif, Calibri; vertical-align: baseline; color: rgb(12, 138, 1);\">প্রকৃতি বীক্ষণ কেন্দ্র</h3><h4><br style=\"font-family: SolaimanLipi, Arial, Vrinda, FallbackBengaliFont, Helvetica, sans-serif, Calibri; font-size: medium; font-weight: normal;\"><span style=\"font-family: SolaimanLipi, Arial, Vrinda, FallbackBengaliFont, Helvetica, sans-serif, Calibri; font-size: medium; font-weight: normal;\">এ কেন্দ্রে বাংলাদেশের প্রায় সকল ধরণের বনাঞ্চলেন গাছপালা ও বন্যপ্রানীর মডেল, মুরাল ও ষ্টাফিং তৈরী করে আলো ও শব্দধ্বনি প্রবাহের মাধ্যমে বন্যপ্রাণী ও বনাঞ্চল সম্পর্কে দর্শকদেরকে সাম্যকে ধারণা প্রদান করা হয় । প্রকৃতি বীক্ষণ কেন্দ্রে প্রায় ৯৮০ ধরণের বন্যপ্রাণী ও অসংখ্য গাছ-পালার মডেল মুরাল তৈরী করা হযেছে । প্রায় ১২ মিনিটের দীর্ঘ একটি স্বব্যখ্যায়িত অডিও-ভিস্যুয়াল (Audio-visual ) প্রোগ্রামের মাধ্যমে দর্শকগণ আনন্দ লাভ করতে পারবেন ।</span><br style=\"font-family: SolaimanLipi, Arial, Vrinda, FallbackBengaliFont, Helvetica, sans-serif, Calibri; font-size: medium; font-weight: normal;\"><br style=\"font-family: SolaimanLipi, Arial, Vrinda, FallbackBengaliFont, Helvetica, sans-serif, Calibri; font-size: medium; font-weight: normal;\"></h4><h3 style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: SolaimanLipi, Arial, Vrinda, FallbackBengaliFont, Helvetica, sans-serif, Calibri; vertical-align: baseline; color: rgb(12, 138, 1);\">বায়োডাইভারসিটি পার্ক</h3><h4><br style=\"font-family: SolaimanLipi, Arial, Vrinda, FallbackBengaliFont, Helvetica, sans-serif, Calibri; font-size: medium; font-weight: normal;\"><span style=\"font-family: SolaimanLipi, Arial, Vrinda, FallbackBengaliFont, Helvetica, sans-serif, Calibri; font-size: medium; font-weight: normal;\">এই পার্ক প্রতিষ্ঠার মূল লক্ষ্য হচ্ছে বিরল, বিলুপ্তপ্রায়, দূলর্ভ ও বিপন্ন প্রজাতির গাছের জীন-পুল সংরক্ষণ (এবহব চড়ড়ষ ঈড়হংবৎাধঃরড়হ) করা। এছাড়া এ পার্কে শালবন এবং জীব-বৈচিত্র্য সংরক্ষণের নিমিত্তে উপযোগী বিভিন্ন প্রজাতির বৃক্ষরোপণ করা হবে। এ পার্কটিকে জাতীয় উদ্ভিদ উদ্যান ও বলদা গার্ডেনের র‌্যাপলিকা হিসাবে স্থাপন করা হবে। বায়োডাইভারসিটি পার্কের এলাকা নিধারণ করা হয়েছে ৯৬৫.০ একর।</span><br style=\"font-family: SolaimanLipi, Arial, Vrinda, FallbackBengaliFont, Helvetica, sans-serif, Calibri; font-size: medium; font-weight: normal;\"><br style=\"font-family: SolaimanLipi, Arial, Vrinda, FallbackBengaliFont, Helvetica, sans-serif, Calibri; font-size: medium; font-weight: normal;\"><br style=\"font-family: SolaimanLipi, Arial, Vrinda, FallbackBengaliFont, Helvetica, sans-serif, Calibri; font-size: medium; font-weight: normal;\"></h4><h3 style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: SolaimanLipi, Arial, Vrinda, FallbackBengaliFont, Helvetica, sans-serif, Calibri; vertical-align: baseline; color: rgb(12, 138, 1);\">এক্সটেনসিভ এশিয়ান সাফারী পার্ক</h3><h4><br style=\"font-family: SolaimanLipi, Arial, Vrinda, FallbackBengaliFont, Helvetica, sans-serif, Calibri; font-size: medium; font-weight: normal;\"><span style=\"font-family: SolaimanLipi, Arial, Vrinda, FallbackBengaliFont, Helvetica, sans-serif, Calibri; font-size: medium; font-weight: normal;\">এই পার্কে সকল এশীয় তৃনভোজী এবং ছোট মাংসাশী প্রাণি, পাখি, সরিসৃপ ও উভচর প্রাণি নিয়ে এক্সটেনসিভ সাফারী পার্ক প্রতিষ্ঠা করা হবে। বন্যপ্রাণির আবাসস্থালের জন্য উপযোগী চারণ ভূমি, বন বাগান, জলাধার, ক্যাম্প প্রতিষ্ঠা ও বিদ্যমান প্রাকৃতিক বনভূমির উন্নয়ন করা হবে। এই পার্কের এলাকা নির্ধারণ করা হয়েছে ৮২৪ একর।</span><p style=\"padding: 15px 0px 0px; border: 0px; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: medium; line-height: 20px; font-family: SolaimanLipi, Arial, Vrinda, FallbackBengaliFont, Helvetica, sans-serif, Calibri; vertical-align: baseline; color: rgb(18, 56, 15); text-align: justify;\"></p><br style=\"font-family: SolaimanLipi, Arial, Vrinda, FallbackBengaliFont, Helvetica, sans-serif, Calibri; font-size: medium; font-weight: normal;\"><br style=\"font-family: SolaimanLipi, Arial, Vrinda, FallbackBengaliFont, Helvetica, sans-serif, Calibri; font-size: medium; font-weight: normal;\"></h4><h3 style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; font-size: 20px; line-height: inherit; font-family: SolaimanLipi, Arial, Vrinda, FallbackBengaliFont, Helvetica, sans-serif, Calibri; vertical-align: baseline; color: rgb(12, 138, 1);\">সাফারী কিংডম এর দর্শনীয় স্হাপনাসমূহ</h3><h4><br style=\"font-family: SolaimanLipi, Arial, Vrinda, FallbackBengaliFont, Helvetica, sans-serif, Calibri; font-size: medium; font-weight: normal;\"><div class=\"list-l\" style=\"margin: 0px 50px 0px 30px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-weight: normal; font-stretch: inherit; font-size: medium; line-height: inherit; font-family: SolaimanLipi, Arial, Vrinda, FallbackBengaliFont, Helvetica, sans-serif, Calibri; vertical-align: baseline; float: left; min-height: 225px;\"><ul style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; list-style: none;\"><li style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit;