INSERT INTO `pages` VALUES (28, 'WOIYTV', 20, 0, 'অবমুক্ত ও বেস্টনিতে রাখা বন্যপ্রাণী', 'অবমুক্ত বন্যপ্রাণী', '', '', 4, 'page', '<h4>নতুন পৃষ্ঠা যোগ করুন</h4>\r\n                            <ul>\r\n                                <li>\r\n                                    আপনি ছবি যোগ করতে পারেন\r\n                                </li>\r\n                                <li>\r\n                                    আপনি টেবিল এবং তালিকা যোগ করতে পারেন\r\n                                </li>\r\n                            </ul>', 1, 82, '127.0.0.1', '1503163273', 82);
