INSERT INTO `pages` VALUES (30, 'GTBPWF', 21, 0, 'ইতিহাস', 'ইতিহাস', 'content/VnNWozecBrjPJYO.png', 'data:image/png;base64,', 1, 'page', '<p><b>বঙ্গবন্ধু শেখ মুজিব সাফারী পার্ক, গাজীপুর</b></p><p>ভাওয়াল গড়ের ছোট ছোট টিলা (চালা) ও নীচু ভূমি (বাইদ) সমৃদ্ধ শালবনে দেখা যেত আমলকি, বহেড়া, হরিতকী, করই, শিমূল, হলদু, পলাশ, চাপালিশ, কুসুম, পিতরাজ, উদাল এবং বিবিধ লতাগুল্মরাজি। এ বনে দেখা যেত মায়া হরিণ, চিতাবাঘ, বন বিড়াল, গন্ধগকুল, শিয়াল, সজারু, অজগর, বানর, হনুমানসহ অসংখ্য প্রজাতির পাখি। শালবনে প্রায় ৬৩ প্রজাতির গাছপালা ও ২২০ প্রজাতির বন্যপ্রাণী দেখা যেত। জনসংখ্যা বৃদ্ধি, নগরায়ন, শিল্পায়ন, বন ধ্বংস করে কৃষি জমির বিস্তার, আবাসন, জবরদখল ও ভূমি বিরোধের কারনে শাল বনের অস্তিত্ব দ্রুত হারিয়ে যাচ্ছে। বন্যপ্রাণী প্রাকৃতিক পরিবেশ, খাদ্যচক্র ও জীববৈচিত্র্যের একটি অবিচ্ছেদ্য অংশ। মানুষের অস্তিত্বের জন্য বন্যপ্রাণীর ভূমিকা অপরিসীম। জীববৈচিত্র্য সংরক্ষণ, ইকোট্যুরিজমের উন্নয়ন, পর্যটন শিল্পের বিকাশ, শিক্ষা, গবেষণা ও চিত্তবিনোদনের সুযোগ সৃষ্টির লক্ষ্যে জাতির জনক বঙ্গবন্ধুর স্মৃতি বিজড়িত ভাওয়ালগড় এলাকায় ‘‘সাফারী পার্ক’’ প্রতিষ্ঠার উদ্যোগ গ্রহন করা হয়।</p><p><br></p><p><br></p><p>গাজীপুর জেলার শ্রীপুর উপজেলাধীন মাওনা ইউনিয়নের বড় রাথুরা মৌজা ও সদর উপজেলার পীরুজালী ইউনিয়নের পীরুজালী মৌজার খন্ড খন্ড শাল বনের ৪৯০৯.০ একর বন ভূমি ছোট বড় বিভিন্ন প্রজাতির প্রাণির জন্য নিরাপদ আবাসস্থল হিসাবে পরিচিত। এর মধ্যে ৩৮১০.০ একর এলাকাকে সাফারী পার্কের মাস্টার প্ল্যানের আওতাভূক্ত করা হয়েছে। বঙ্গবন্ধু শেখ মুজিব সাফারী পার্ক শীর্ষক প্রকল্পটি ২০১০ সালে ৬৩.৯৯ কোটি টাকা প্রাক্কলিত ব্যয়ে একনেক কর্তৃক অনুমোদিত হয় এবং পার্ক প্রতিষ্ঠা কার্যক্রম শুরু হয় এবং ২০১১ সালের ২ ফেব্র“য়ারী বঙ্গবন্ধু শেখ মুজিব সাফারী পার্ক, গাজীপুর এর আনুষ্ঠানিকভাবে নির্মাণ কার্যক্রম শুরু হয়। প্রকল্পের শুরুতে কোন মাষ্টার প্লান প্রণয়ন করা সম্ভব হয়নি। পরবর্তীতে দেশী-বিদেশী বিশেষজ্ঞদের সহায়তায় আন্তর্জাতিক মানের সাফারী পার্কে উন্নীত করার লক্ষ্যে একটি মাষ্টার প্লান তৈরী করা হয়। মাষ্টার প্লানে বর্ণিত কার্যক্রম বাস্তবায়ন ও ভূমি অধিগ্রহনের জটিলতা নিরসনের লক্ষ্যে ৪ অক্টোবর ২০১১ তারিখে ’’বঙ্গবন্ধু শেখ মুজিব সাফারী পার্ক, গাজীপুর (১ম সংশোধিত) প্রকল্পটি একনেক কর্তৃক বর্ধিত আকারে ২১৯.৮৯ কোটি টাকা প্রাক্কলিত ব্যয়ে অনুমোদিত হয়। পরবর্তীতে অক্টোবর / ২০১৩ মাসে একনেক কর্তৃক ২৬৩.০০ কোটি টাকা ব্যয়ে ” বঙ্গবন্ধু শেখমুজিব সরকারী পার্ক , গাজীপূর (২য় সংশোধন) প্রকল্প পাশ হয় ।</p><p><br></p><p>সাফারী পার্কটি দক্ষিণ এশীয় মডেল বিশেষ করে থাইল্যান্ডের সাফারী ওয়ার্ল্ড এর সাথে সামঞ্জস্য রেখে স্থাপন করা হয়েছে। এছাড়াও ইন্দোনেশিয়ার বালি সাফারী পার্কের কতিপয় ধারনা সন্নিবেশিত করা হয়েছে। সাফারী পার্কের চারদিকে নির্মাণ করা হচ্ছে স্থায়ী ঘেরাা এবং উহার মধ্যে দেশী/বিদেশী বন্যপ্রাণীর বংশবৃদ্ধি ও অবাধ বিচরণের সুযোগ সৃষ্টি করা হয়েছে যাতে পর্যটকগণ চলমান যানবাহনে অথবা পায়ে হেঁটে ভ্রমণ করে শিক্ষা, গবেষণা ও চিত্তবিনোদনের সুযোগ লাভ করবেন। সাফারী পার্কের ধারনা চিড়িয়াখানা হতে ভিন্নতর। চিড়িয়াখানায় জীবজন্তুসমূহ আবদ্ধ অবস্থায় থাকে এবং দর্শনার্থীগণ মুক্ত অবস্থায় থেকে জীবজন্তু পরিদর্শন করেন। কিন্তু সাফারী পার্কে বন্যপ্রাণীসমূহ উন্মুক্ত অবস্থায় বনজঙ্গলে বিচরণ করবে এবং মানুষ সতর্কতার সহিত চলমান যানবাহনে আবদ্ধ অবস্থায় জীবজন্তুসমূহ পরিদর্শন করবেন।&nbsp;</p><p>&nbsp;</p>', 1, 82, '127.0.0.1', '1503163316', 88);
