  `shift_date` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `shift_time` varchar(20) COLLATE utf8_unicode_ci NOT NULL,
  `duration` varchar(20) COLLATE utf8_unicode_ci NOT NULL,
  `tickets` int(6) NOT NULL,
  `status` int(1) NOT NULL,
  `created_by` int(4) NOT NULL,
  `created_from` varchar(20) COLLATE utf8_unicode_ci NOT NULL,
