  PRIMARY KEY (`shift_id`) USING BTREE,
  UNIQUE KEY `unique_page` (`unique_id`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=60 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ROW_FORMAT=DYNAMIC;

