-- ----------------------------
-- Table structure for user
-- ----------------------------
DROP TABLE IF EXISTS `user`;
CREATE TABLE `user` (
  `user_id` int(11) NOT NULL AUTO_INCREMENT,
  `unique_id` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `username` varchar(30) COLLATE utf8_unicode_ci NOT NULL,
  `password` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `email` varchar(30) COLLATE utf8_unicode_ci NOT NULL,
  `phone` varchar(14) COLLATE utf8_unicode_ci NOT NULL,
  `first_name` varchar(30) COLLATE utf8_unicode_ci NOT NULL,
  `last_name` varchar(30) COLLATE utf8_unicode_ci NOT NULL,
  `date_of_birth` varchar(12) COLLATE utf8_unicode_ci NOT NULL,
  `picture` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `register_ip` varchar(20) COLLATE utf8_unicode_ci NOT NULL,
  `register_time` varchar(20) COLLATE utf8_unicode_ci NOT NULL,
  `last_seen` varchar(20) COLLATE utf8_unicode_ci NOT NULL,
  `notification` int(1) NOT NULL DEFAULT '0',
  `key` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `token` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `deviceToken` longtext COLLATE utf8_unicode_ci,
  `platform` varchar(100) COLLATE utf8_unicode_ci NOT NULL DEFAULT '0',
  `provider` varchar(20) COLLATE utf8_unicode_ci DEFAULT '0',
  `social_id` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '0',
  `social_url` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '0',
  `state` int(1) NOT NULL DEFAULT '0',
  `status` int(1) NOT NULL DEFAULT '0',
  `verified` int(1) NOT NULL DEFAULT '0',
  `2_step` int(1) NOT NULL DEFAULT '0',
  `modify_by` int(6) NOT NULL DEFAULT '0',
  PRIMARY KEY (`user_id`) USING BTREE,
  UNIQUE KEY `username` (`username`) USING BTREE,
  UNIQUE KEY `email` (`email`) USING BTREE,
  UNIQUE KEY `unique_user` (`unique_id`) USING BTREE,
  UNIQUE KEY `phone` (`phone`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=97 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ROW_FORMAT=COMPACT;

